import React, { useState } from "react";
import HomeLayout from "../../layout/HomeLayout/HomeLayout";
import Splash from "../../components/splash/splash";
import Expert from "../../assets/images/Rectangle24379.png";
const Profile = () => {
  const [loading, setLoading] = useState(true);
  setTimeout(() => {
    setLoading(false);
  }, 2000);
  const offering = [
    {
      id: 1,
      title: "Ask a Vet",
      description:
        "You can ask me any question about a single issue you are facing regarding your specialization field",
      price: "129",
      cta: "Ask",
    },
  ];

  return (
    <HomeLayout>
      {loading ? (
        <Splash />
      ) : (
        <section
          style={{
            paddingTop: "90px",
            backgroundColor: "#f3f4f6",
            paddingBottom: "70px",
          }}
        >
          <div style={{ zIndex: "10", paddingTop: "32px" }}>
            <div style={{ textAlign: "center" }}>
              <img
                style={{ height: "100%", width: "232px", borderRadius: "6px" }}
                src={Expert}
                alt=""
              />
              <p
                className="mb-0 font-30 mt-16 font-semi "
                style={{
                  lineHeight: "30px",
                  marginBottom: "0",
                  fontSize: "30px",
                  marginTop: "16px",
                  fontWeight: "600",
                }}
              >
                Er.
              </p>
              <p
                className="mb-0 mt-10 font-16 font-regular"
                style={{ lineHeight: "16px" }}
              >
                Frontend
              </p>
              <p
                className="mb-0  font-16 font-regular"
                style={{ lineHeight: "16px", marginTop: "4px" }}
              >
                25 years experience
              </p>

              <div
                className="d-flex justify-content-center mt-16 pb-24"
                style={{ gap: "10px" }}
              >
                <div
                  className="px-16 py-16 radius-8"
                  style={{ backgroundColor: "#F3F4F6" }}
                >
                  <p
                    className="mb-0 font-16 font-medium"
                    style={{ lineHeight: "16px" }}
                  >
                    -
                  </p>
                  <p
                    className="mb-0 mt-8 font-medium"
                    style={{
                      fontSize: "13px",
                      lineHeight: "12px",
                      opacity: "0.5",
                    }}
                  >
                    Ratings
                  </p>
                </div>
                <div
                  className="px-16 py-16 radius-8"
                  style={{ backgroundColor: "#F3F4F6" }}
                >
                  <p
                    className="mb-0 font-16 font-medium"
                    style={{ lineHeight: "16px" }}
                  >
                    -
                  </p>
                  <p
                    className="mb-0 mt-8 font-medium"
                    style={{
                      fontSize: "13px",
                      lineHeight: "12px",
                      opacity: "0.5",
                    }}
                  >
                    found them helpful
                  </p>
                </div>
              </div>
            </div>
          </div>
          <div>
            <div
              style={{
                marginTop: "24px",
                padding: "0 24px",
                backgroundColor: "#f3f4f6",
              }}
            >
              <p
                style={{
                  lineHeight: "26px",
                  marginBottom: "0",
                  fontSize: "26px",
                  fontWeight: "700",
                  paddingTop: "24px",
                }}
              >
                Offering
              </p>
              {offering.map((item, id) => {
                return (
                  <div
                    key={id}
                    style={{
                      textAlign: "start",
                      marginTop: "18px",
                      backgroundColor: "#fff",
                      padding: "8px",
                      borderRadius: "4px",
                    }}
                  >
                    <p
                      style={{
                        fontSize: "18px",
                        marginBottom: "0px",
                        fontWeight: "600",
                      }}
                    >
                      {item.title}:-
                    </p>
                    <p
                      style={{
                        opacity: "0.8",
                        fontSize: "18px",
                        fontWeight: "500",
                        lineHeight: "24px",
                        marginTop: "8px",
                      }}
                    >
                      {item.description}
                    </p>
                    <div style={{ display: "flex" }}>
                      <p
                        style={{
                          lineHeight: "18px",
                          flex: "0.6",
                          marginBottom: "0px",
                          marginTop: "8px",
                          fontFamily: "monotype corsiva",
                          fontSize: "26px",
                        }}
                      >
                        at Rs {item.price}
                      </p>
                      <p
                        style={{
                          textAlign: "center",
                          flex: "0.4",
                          fontSize: "16px",
                          borderRadius: "8px",
                          backgroundColor: "#171717",
                          color: "#fff",
                          padding: "10px 14px 10px 14px",
                        }}
                      >
                        {item.cta}
                      </p>
                    </div>
                  </div>
                );
              })}
            </div>
          </div>
        </section>
      )}
    </HomeLayout>
  );
};

export default Profile;
